
#include <bits/stdc++.h>
using namespace std;

string minWindow(string s, string t) {
    //cout << "length need: " << 'z' - 'A' << endl;
    //string res;
    //queue<int> pinBegin;
    int count = 0;
    int tlen = t.size();
    int le = 0, ri =0, si = -1;
    int min_len = INT_MAX;
    vector<int> fret(58,0);
    if (s.size() < t.size()) return "";

    for (auto i:t){
        fret[i-'A']++;
    }

    while (ri < s.size()){
        if (fret[s[ri++]-'A']-- >0) count++;
        while (count == tlen){
            if (min_len > ri-le){
                min_len = ri-le;
                si = le;
            }
            if (++fret[s[le++]-'A'] >0) count--;
        }
    }
    return si == -1 ? "":s.substr(si,min_len);

}

int main(int arg, char* argv[]){
    string s = "";
    string t = "aAbBcCdDeEfFgGhHiIjJkKlLmMnNoOpPqQrRsStTuUvVwWxXyYzZ";
    string res = minWindow(s,t);
    cout << "Result: \n";
    cout << res << endl;
    return 1;
}

